The Guardians of the Galaxy relaunched in a new modern incarnation in 2008, with a team full of cosmic freaks and weirdos defending the Marvel Universe. This is their story, as written by Dan Abnett and Andy Lanning. This torrent collects the full run of of v2 before the Marvel NOW initiative, numbering issues 01-25. All are digital versions - the first 18 are courtesy of ZoneKing-Empire and 19-25 are HD thanks to BlackManta-Empire. Please seed, enjoy! :-)
